import React from "react";

export default function Experience() {
  return (
    <div className="container mx-auto mt-40 grid justify-center">
      <div className="title">
        <h3 className="text-3xl font-semibold flex">
          <span className="title-about__number"> 02. </span> Where I've Worked
          <span className="strip"> </span>
        </h3>
      </div>
      <div className="desc-experiense">
        <div>
          <h5>Freelance Content Writer @ Pepper</h5>
        </div>
      </div>
    </div>
  );
}
